An issue with cgal (see bd4e281bed797770f1f9fe9e6d217ce9a697b0ad for the fix) prompted me to look at what [MacPorts does for default cmake parameters](https://trac.macports.org/browser/trunk/dports/_resources/port1.0/group/cmake-1.0.tcl
). Maybe we want to adopt some of these (particularly the two that fixed the install name issue in the aformentioned commit)?

(As an aside, it would be nice if `std_cmake_parameters` was an array with a set of helper methods for appending and removing things. But I only count 68 formulae that use it, so it might not be too nightmarish to fix; I'll probably dork around with it a bit.)

